import { Route, BrowserRouter } from 'react-router-dom';
import Home from './components/Home';
import Header from './components/Header';
import Provider from './context/Provider';


function App() {
  return (
    <BrowserRouter>
      <Provider>
        <Header />
          <Route exact path="/" element={<Home />} />
      </Provider>
  </BrowserRouter>
  );
}

export default App;
